import './App.css';
import About from './Images/Pages/about/About';
import Advocates from './Images/Pages/advocates/Advocates';
import Blog from './Images/Pages/blog/Blog';
import Contacts from './Images/Pages/contact/Contacts';
import Home from './Images/Pages/home/Home';
import Services from './Images/Pages/services/Services';


function App() {
  return (
    <BrowserRouter>
    <Navbar/>
      <About/>
      <Advocates/>
      <Blog/>
      <Contacts/>
      <Home/>
      <Services/>    
       </BrowserRouter>
  );
}

export default App;
